#include <stdio.h>

int main()
{
  int a, b;
  scanf("%d", &a);
  if(a >= 90){
    b = 'A';
    a = 95; 
  }  else if (a >= 80){
    b = 'B';
    a = 85;
  }  else if (a >= 70){
    b = 'C';
    a = 75;
  }  else if (a >= 60){
    b = 'D';
    a = 65;
  }  else if (a < 60){
    b = 'F';
  }
  printf("%c %d\n", b, a);
  return 0;
}

